sys_script_include.script:
var ModTrak = Class.create();
ModTrak.prototype = {
    initialize: function(
		requestor,
		applicationName,
		applicationFunction = null,
		subject,
		status,
		description,
		reasonForChange,
		changeType,
		priority,
		refNumber,
		requestDate,
		requestedDueDate,
		department,
		workflowFlag = "Y",
		deptApprover = null,
		deptApprDate = null,
		workStartedDate,
		completeDate,
		infoTechApprover = null,
		infoTechApprDate = null
	) {
		this.requestor = requestor;
		this.applicationName = applicationName;
		this.applicationFunction = applicationFunction;
		this.subject = subject;
		this.status = status;
		this.description = description;
		this.reasonForChange = reasonForChange;
		this.changeType = changeType;
		this.priority = priority;
		this.refNumber = refNumber;
		this.requestDate = requestDate;
		this.requestedDueDate = requestedDueDate;
		this.department = department;
		this.workflowFlag = workflowFlag;
		this.deptApprover = deptApprover;
		this.deptApprDate = deptApprDate;
		this.workStartedDate = workStartedDate;
		this.completeDate = completeDate;
		this.infoTechApprover = infoTechApprover;
		this.infoTechApprDate = infoTechApprDate;
    },

    type: 'ModTrak'
};
